import React from 'react';
import {
  Radar, RadarChart, PolarGrid, PolarAngleAxis, PolarRadiusAxis
} from 'recharts';
import '../Css/Dashboard.css';

const data = [
  {
    subject: 'Dominant', A: 20, B: 30,
  },
  {
    subject: 'Invloedrijk', A: 10, B: 20,
  },
  {
    subject: 'Stabiel', A: 30, B: 10,
  },
  {
    subject: 'Censcientieus', A: 25, B: 35,
  },
];

const Dashboard = () => {
  return (
    <div className="dashboard">
      {/* Rest of the code */}
      <div className="main">
        {/* Rest of the code */}
        <div className="content">
          <div className="radar-chart">
            <RadarChart cx={300} cy={250} outerRadius={150} width={600} height={500} data={data}>
              <PolarGrid />
              <PolarAngleAxis dataKey="subject" />
              <PolarRadiusAxis angle={90} domain={[0, 50]} />
              <Radar name="Mike" dataKey="A" stroke="#3487C7" fill="#3487C7" fillOpacity={0.6} />
              <Radar name="John" dataKey="B" stroke="#FF4500" fill="#FF4500" fillOpacity={0.6} />
            </RadarChart>
          </div>
          <div className="results">
            {/* Rest of the code */}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
